import React from 'react';
import Nav from './Nav';

const Projects = () => {
  const projects = [
    { title: 'Project 1', description: 'A web app built with React', link: 'https://github.com/yourname/project1' },
    { title: 'Project 2', description: 'A website using HTML, CSS, and JavaScript', link: 'https://github.com/yourname/project2' },
  ];

  return (
    <div>
      <Navbar />
      <section>
        <h2>Projects</h2>
        <ul>
          {projects.map((project, index) => (
            <li key={index}>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">View on GitHub</a>
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
};

export default Projects;
